import React from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  return (
    <div>
      {teams.map((team, i) => {
        return (
          <div className="team-wrap">
            <Link key={i} to={`/teams/${team.abbreviation}`}>
              <p>{team.full_name}</p>
            </Link>
          </div>
        );
      })}
    </div>
  );
}
